import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import { withAutorization } from '../Autorization.js';

class Panier extends Component{

	render(){
		return(
				<div class="box box-2">
					<h1>Covid-19</h1>
				</div>	
			)
	}

    
}

export default withAutorization(Panier);
